import React from 'react';
import Crypto from 'crypto';
import PrintButton from './PrintButton';
import styles from './Code.module.css';

const Code = (): JSX.Element => {
  const [message, setMessage] = React.useState('');

  const codes: { [key: string]: string } = {
    'b54106cabb0b0cbd6678c7c9db883e3c980c3200bf2c5c8937a629df96316f71': '',
    '3a506d6bbb0ef6df0c7fa2f5ec9a8e543b5274ff45a01dc047187ac8a107a3ec': '',
  };

  const getHash = (value: string): string => {
    return Crypto.createHash('sha256').update(value).digest('hex');
  };

  const checkCode = (value: string): void => {
    value = value.trim().toLowerCase();
    let hash = getHash(value);
    if (!codes[hash]) {
      value = value.split('').sort().join('');
      hash = getHash(value);
    }
    const secret = codes[hash];
    if (secret) {
      while (value.length < 32) {
        value += value;
      }
      const key = new TextEncoder().encode(value).slice(0, 32);
      setMessage(Crypto.createDecipheriv('aes-256-gcm', key, hash).update(secret, 'hex').toString());
    }
  };

  return (
    <div className={styles.code}>
      <input className={styles.code + ' noprint'} onChange={(event) => checkCode(event.target.value)}/>
      {
        message.length > 0 ?
          <div>
            <div className={styles.message} dangerouslySetInnerHTML={{__html: message}}/>
            <PrintButton/>
          </div>
          :
          ''
      }
    </div>
  );
};

export default Code;
